import logo from './logo.svg';
import './App.css';
import Welcome from './Welcome.js';
import React from 'react';
import Electronics from './Electronics.jsx';
import New from './New.jsx'
import ArrayOfObjects from './ArrayOfObjects.jsx';
import Property from './Property.jsx';
import {useState} from 'react';

const [subject , setSubject] = useState("react");

let newFunc = ()=>{
     return "mansi";
}


function App() {
  let oldArr=["fans","lights","leds","iron"]
  let newArr = oldArr.map((item)=>{
    return(<div>{item}</div>)
  })


  return (
    <div className="App">
      < Welcome/>
      < Electronics/>
      < New/>
      <ArrayOfObjects/>
      <Property arr={newArr} name={newFunc}/>


    </div>
  );
}

export default App;
